# =========================================
# QuoteSync - Restore working files (App.tsx, GridEditor.tsx, main.tsx) from uploaded known-good versions
# Run from: PS C:\Github\QuoteSync\web\ps1_patches>
# =========================================

$ErrorActionPreference = "Stop"

function Ok($m){ Write-Host "OK: $m" -ForegroundColor Green }
function Fail($m){ Write-Host "ERROR: $m" -ForegroundColor Red; throw $m }

function Get-ScriptDir {
  if ($PSScriptRoot -and $PSScriptRoot.Trim().Length -gt 0) { return $PSScriptRoot }
  if ($MyInvocation -and $MyInvocation.MyCommand -and $MyInvocation.MyCommand.Path) { return (Split-Path -Parent $MyInvocation.MyCommand.Path) }
  return (Get-Location).Path
}

function Write-AtomicUtf8FromBase64($target, $b64) {
  $clean = ($b64 -replace "\s","")
  $bytes = [Convert]::FromBase64String($clean)
  $dir = Split-Path -Parent $target
  if (-not (Test-Path $dir)) { New-Item -ItemType Directory -Force -Path $dir | Out-Null }
  $tmp = Join-Path $dir ((Split-Path -Leaf $target) + ".__tmp__")
  [System.IO.File]::WriteAllBytes($tmp, $bytes)
  Move-Item -Force $tmp $target
}

$scriptDir = Get-ScriptDir
$webRoot = (Resolve-Path (Join-Path $scriptDir "..")).Path

Write-Host ("Run directory: " + (Get-Location).Path)
Write-Host ("Script directory: " + $scriptDir)
Write-Host ("Working directory: " + $webRoot)

if (-not (Test-Path $webRoot)) { Fail "Web root not found: $webRoot" }

Set-Location $webRoot

$backupDir = Join-Path $webRoot "_backups"
New-Item -ItemType Directory -Force -Path $backupDir | Out-Null
$stamp = Get-Date -Format "yyyyMMdd_HHmmss"

function Backup-File($pathRel) {
  $full = Join-Path $webRoot $pathRel
  if (Test-Path $full) {
    $safe = ($pathRel -replace "[\\/:*?\"<>|]", "_")
    $bak = Join-Path $backupDir ("0.1.bak" -f $safe, $stamp)
    Copy-Item -Force $full $bak
    Ok "Backup written: $bak"
  } else {
    Ok "No existing file to backup: $pathRel"
  }
}

# Targets
$appTarget  = Join-Path $webRoot "src\App.tsx"
$gridTarget = Join-Path $webRoot "src\components\GridEditor.tsx"
$mainTarget = Join-Path $webRoot "src\main.tsx"

Backup-File "src\App.tsx"
Backup-File "src\components\GridEditor.tsx"
Backup-File "src\main.tsx"

